Lex["00"] = "'Special Concordance Entry|||||The original word in the Greek or Hebrew is translated by more than one word in the English. The English translation is separated by one or more other words from the original.  e.g. Mat. 15:30     Strong's No. 630            English        to send away                send 630 0 her 846 away 630 Here the verb \"send away\" is split by the word \"her\". The zero means the verb only occurs once in this passage not twice. Sometimes five or six words separate a word.    Some exceptions are in Jer. 51:3 where the zero in \"bendeth 1869 0 let the archer 1869 8802 bend 1869 8799\"    connects \"bendeth\" with \"bend\" not \"archer\". See also Nu:16:13, 22:17, 2Sa 12:14";
