Lex["03999"] = "mabbuwl {mab-bool'}|AV - flood 13; 13|from 02986 in the sense of flowing|TWOT - 1142|n m|INDENT0--<b>1)</b> flood, deluge.<BR>INDENT3-- <b>a)</b> Noah's flood that submerged the entire planet earth under water        for about a year<BR>++++<BR>   Some think Noah's flood was only local. However the description of it found in Gen. 6 through 8 makes this patently absurd. If it was local, Noah had 120 years to migrate out of the area to safe ground! Why waste all that effort building a ship? He only had to move less than 1500 feet a day to reach the farthest point on the globe!   With the possible exception of Ps. 29:10, this word always refers to Noah's flood. The real reason for insisting on a local flood is the acceptance of evolution with its long geological ages. Most holding that view are not willing to allow a global world wide flood to have happened less than 5000 years ago. To admit such eliminates the need for the geological ages for most of the geological column would have be rapidly laid down by Noah's flood.";
