Lex["08438"] = "towla` {to-law'} and (fem) towle`ah {to-lay-aw'} or<BR> &nbsp;&nbsp;&nbsp;towla`ath {to-lah'-ath}; or tola`ath {to-lah'-ath}|AV - scarlet 34, worm 8, crimson 1; 43|from 03216|TWOT - 2516b|n m|INDENT0--<b>1)</b> worm, scarlet stuff, crimsonINDENT3-- <b>a)</b> worm - the female 'coccus ilicis'INDENT3-- <b>b)</b> scarlet stuff, crimson, scarletINDENT7--<b>1)</b> the dye made from the dried body of the female of the             worm \"coccus ilicis\"INDENT0--<b>2)</b> worm, maggotINDENT3-- <b>a)</b> worm, grubINDENT3-- <b>b)</b> the worm \"coccus ilicis\"<BR>++++<BR>   When the female of the scarlet worm species was ready to give birth to her young, she would attach her body to the trunk of a tree, fixing herself so firmly and permanently that she would never leave again. The eggs deposited beneath her body were thus protected until the larvae were hatched and able to enter their own life cycle. As the mother died, the crimson fluid stained her body and the surrounding wood. From the dead bodies of such female scarlet worms, the commercial scarlet dyes of antiquity were extracted.   What a picture this gives of Christ, dying on the tree, shedding his precious blood that he might \"bring many sons unto glory\" (\"#Heb 2:10\")! He died for us, that we might live through him!   \"#Ps 22:6\" describes such a worm and gives us this picture of Christ. (cf. \"#Isa 1:18\")   (from page 73, \"Biblical Basis for Modern Science\", 1985,    Baker Book House, by Henry Morris)";
